import React, { Component } from 'react'


class Splash extends Component{
  render(){
    return(
      <div className="splash">
        <div className="splash-copy">
          <h1>Austinited.</h1>
          <p>I speak from experience when I say that moving to Austin can leave you overwhelmed. <b>I'm on a mission to make it better for all of us. </b> <br/><br/> Stay tuned for the next version of <b>Austinited.com</b> that will bring a much needed <b>user-friendly</b> experience to finding the best spots in <b>Austin, TX.</b></p>
        </div>
      </div>
    )
  }
}

export default Splash;
